import React, { useState } from "react";

function App() {
  const [url, setUrl] = useState("");
  const [quality, setQuality] = useState("best");
  const [logs, setLogs] = useState([]);
  const [progress, setProgress] = useState(null);
  const [downloading, setDownloading] = useState(false);

  const startDownload = () => {
    setLogs([]);
    setProgress(null);
    setDownloading(true);

    const eventSource = new EventSource(
      `http://localhost:8080/api/youtube/download/stream?url=${encodeURIComponent(url)}&format=${quality}&t=${Date.now()}`
    );

    eventSource.onmessage = (e) => {
      const message = e.data;

      if (message.startsWith("PROGRESS::")) {
        const [, percent, size, speed, eta] = message.split("::");
        setProgress({ percent, size, speed, eta });
      } else {
        setLogs((prev) => [...prev, message]);
      }
    };

    eventSource.onerror = () => {
      eventSource.close();
      setDownloading(false);
    };
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Segoe UI", background: "#f8f9fa", minHeight: "100vh" }}>
      <h2 style={{ color: "#d63384" }}>🎬 YouTube Downloader</h2>

      <input
        style={{ width: "60%", padding: "10px", margin: "10px 0", borderRadius: "6px", border: "1px solid #ccc" }}
        type="text"
        placeholder="Enter YouTube URL"
        value={url}
        onChange={(e) => setUrl(e.target.value)}
      />

      <select
        value={quality}
        onChange={(e) => setQuality(e.target.value)}
        style={{ padding: "10px", marginLeft: "10px", borderRadius: "6px", border: "1px solid #ccc" }}
      >
        <option value="best">Best</option>
        <option value="8k">8K</option>
        <option value="4k">4K</option>
        <option value="1080p">1080p</option>
        <option value="720p">720p</option>
        <option value="480p">480p</option>
        <option value="360p">360p</option>
      </select>

      <button
        onClick={startDownload}
        disabled={downloading}
        style={{
          padding: "10px 20px",
          marginLeft: "10px",
          background: downloading ? "#6c757d" : "#198754",
          color: "white",
          border: "none",
          borderRadius: "6px",
          cursor: "pointer",
        }}
      >
        {downloading ? "Downloading..." : "Start Download"}
      </button>

      {progress && (
        <div style={{ marginTop: "20px", padding: "15px", background: "#fff3cd", borderRadius: "8px" }}>
          <h4 style={{ margin: 0 }}>📊 Download Progress</h4>
          <div>🔁 Progress: <strong>{progress.percent}</strong></div>
          <div>📦 Size: <strong>{progress.size}</strong></div>
          <div>🚀 Speed: <strong>{progress.speed}</strong></div>
          <div>⏳ ETA: <strong>{progress.eta}</strong></div>
        </div>
      )}

      <pre
        style={{
          background: "#e9ecef",
          padding: "15px",
          marginTop: "20px",
          borderRadius: "8px",
          maxHeight: "300px",
          overflowY: "auto",
          color: "#343a40"
        }}
      >
        {logs.join("\n")}
      </pre>
    </div>
  );
}

export default App;
